import React from "react";

const NewUser = () => {
  return (
    <div>
      <h1>Hello world!</h1>
      <label>User</label>
      <input type="text"></input>
      <label>Age</label>
      <input type="number"></input>
      <input type="button"></input>
    </div>
  );
};

export default NewUser;
